import React from "react";
import styled from 'styled-components';

const PicContainer = styled.div`
  background-color: #f2f2f2;
  width: 330px;
  height: 504px;

  > .photoContainer {
    width: 300px;
    height: 300px;
    background-color: #404040;
  }
`;

const PicHome = () => {
    return (
        <div>
            <PicContainer>
                <div className="photoContainer"></div>
            </PicContainer>  
        </div>
)}
export default PicHome;
